pragma solidity ^0.4.23;

import "./AddressUtil.sol";

contract BaseAdmin {
    bool public isPaused;

    address public addrAdmin;
    address public operator;

    constructor() public {
        isPaused = false;
        addrAdmin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == addrAdmin, "not admin");
        _;
    }

    modifier onlyOperator() {
        require(msg.sender == operator, "not op");
        _;
    }

    modifier onlyHuman() {
        require(msg.sender == tx.origin, "not human");
        _;
    }

    modifier unPaused() {
        require(!isPaused, "paused");
        _;
    }

    function setAdmin(address _newAdmin) external onlyAdmin {
        require(_newAdmin != address(0), "_newAdmin can't be address 0");
        addrAdmin = _newAdmin;
    }

    function setOperator(address _addr) external onlyAdmin {
        require(_addr != address(0), "_addr can't be address 0");
        operator = _addr;
    }

    function setPause(bool _pause) external onlyAdmin {
        isPaused = _pause;
    }
}


contract FinanceAdmin is BaseAdmin{
    address public finance;
    using AddressUtil for address;

    constructor() public {
        finance = msg.sender;
    }

    modifier onlyFinance() {
        require(msg.sender == finance, "not finance");
        _;
    }

    function setFinance(address _addr) external onlyFinance {
        require(_addr != address(0), "_addr is 0");
        finance = _addr;
    }

    function updateVersion(IBEP20[]  bep20s) external onlyAdmin {
        require(finance != address(0), "finance is 0");

        (uint256 bnbBalance, uint256[] memory bepBalances) = address(this).getAllBalance(bep20s);
        finance.transferAll(bnbBalance, bepBalances);
    }
}
